const Auth = () => {
    const {isAuth} = useSelector(state => state.userReducer)

    const navigate = useNavigate()

        if (isAuth) {
            navigate("/");
        }


    return (
        <div>
            {/*{isAuth && <Navigate to="/" replace={true} />}*/}
            AUTH
        </div>
    );
};

export default Auth;
